import React from "react";
import { useNavigate } from "react-router-dom";
import HealthCheck from "./HealthCheck";

const Header = ({ email }) => {
  const navigate = useNavigate();

  const logout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("email");
    navigate("/");
  };

  return (
    <header style={{ padding: "20px", background: "#333", color: "#fff", display: "flex", justifyContent: "space-between" }}>
      <h1>Welcome to React Assignment</h1>
      <div style={{ display: "flex", alignItems: "center" }}>
        <p style={{ marginRight: "20px" }}>Welcome, {email.split('@')[0]}</p>
        <HealthCheck />
        <button onClick={logout} style={{ padding: "10px", background: "#f00", color: "#fff", border: "none", borderRadius: "5px" }}>
          Logout
        </button>
      </div>
    </header>
  );
};

export default Header;
